import { Component, OnInit } from '@angular/core';
import { AuthApiService } from '../../../core/auth/auth-api.service';
import { AuthStorageService } from '../../../core/auth/auth-storage.service';
import { AuthNavigationService } from '../../../core/auth/auth-navigation.service';

@Component({
  selector: 'app-select-role',
  templateUrl: './select-role.component.html',
  styleUrls: ['./select-role.component.css'],
})
export class SelectRoleComponent implements OnInit {
  selectedRole: 'User' | 'Instructor' | null = null;
  mobileNumber = '';

  constructor(
    private authApi: AuthApiService,
    private storage: AuthStorageService,
    private navigation: AuthNavigationService
  ) {}

  ngOnInit(): void {
    const role = this.storage.getRole();
    if (role) {
      this.navigation.navigateByRole(role);
    }
  }

  // ===============================
  // USER → direct flow
  // ===============================
  selectRole(role: 'User'): void {
    this.authApi.setMyRole(role).subscribe({
      next: () => {
        this.storage.setRole(role);
        this.navigation.navigateByRole(role);
      },
      error: (err) => {
        console.error('Set role failed:', err);
        alert('Failed to set role. Please try again.');
      },
    });
  }

  // ===============================
  // INSTRUCTOR → show mobile input
  // ===============================
  onInstructorSelected(): void {
    this.selectedRole = 'Instructor';
  }

  // ===============================
  // CONFIRM INSTRUCTOR
  // ===============================
  confirmInstructorRole(): void {
    if (this.mobileNumber.length !== 10) return;

    this.authApi.setMyRole({ role: 'User' }).subscribe({
      next: () => {
        this.storage.setRole('User');
        this.navigation.navigateByRole('User');
      },
    });
    this.authApi
      .setMyRole({ role: 'Instructor', mobileNumber: this.mobileNumber })
      .subscribe({
        next: () => {
          this.storage.setRole('Instructor');
          this.navigation.navigateByRole('Instructor');
        },
        error: (err) => {
          console.error('Set instructor role failed:', err);
          alert('Failed to set role. Please try again.');
        },
      });
  }
}
<div class="role-container">
  <div class="role-card">

    <h2 class="title">Choose Your Role</h2>
    <p class="subtitle">
      Please select how you want to continue
    </p>

    <!-- ROLE BUTTONS -->
    <div class="role-buttons">
      <button
        class="role-btn user"
        (click)="selectRole('User')">
        I am a Student
      </button>

      <button
        class="role-btn instructor"
        (click)="onInstructorSelected()">
        I am an Instructor
      </button>
    </div>

    <!-- MOBILE INPUT (ONLY FOR INSTRUCTOR) -->
    <div class="mobile-box" *ngIf="selectedRole === 'Instructor'">
      <label>Instructor Mobile Number</label>

      <input
        type="tel"
        class="form-control"
        placeholder="Enter 10-digit mobile number"
        [(ngModel)]="mobileNumber"
        maxlength="10"
        pattern="[0-9]{10}"
      />

      <button
        class="btn btn-primary"
        [disabled]="mobileNumber.length !== 10"
        (click)="confirmInstructorRole()">
        Continue
      </button>
    </div>

  </div>
</div>
